import React from 'react';
import CHoose from './choose';

function ChooseDoc()
{
    const [docs, setDocs] = useState([]);

  useEffect(() => {
       fetch('/Doc.json') 
      .then((res) => res.json())
      .then((result) => {
        console.log('Fetched Data:', result);
        setDocs(result);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, []);
    return(
    <div className='assign'>
        <u><p className='home-logout'><a href='/SignInPage'>logout</a></p></u>
        <u><p className='home-logout'><a href='/'>Home</a></p></u>
        <h1 className='header2'>Doctors list</h1>
        <table >
          <thead>
           <tr >
            <th>Name</th>
            <th>speciality</th>
           </tr>
          </thead>
          <body>
          {doctors.map((doctors, index) => {
            // Use an if statement to conditionally render appointments with the name "osama"
            if (doctors.Name.toLowerCase() =='ahmed') {
              return (
                <tr key={index}>
                  <td>{doctors.Name}</td>
                  <td>{doctors.speciality}</td>
                  <td>{doctors.Day1}</td>
                  <td>{doctors.Start1}</td>
                  <td>{doctors.end1}</td>
                </tr>
              );
            } else {
              return null;
            }
          })}
        </body>
        </table>
        <button ><a href='/'>Back</a></button>
    </div>
    )
    
}
export default ChooseDoc;
